import React, {Component} from 'react';

export default class AddEmpData extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="card col-md-6 o-hidden border-0 shadow-lg my-5">
                <div className="card-body">
                        <form className="user">
                            <div className="form-group row">
                                <div className="row col-md-6">
                                    <div className="col-sm-6">
                                        <input type="text"
                                               className="form-control form-control-user" i
                                               d="exampleFirstName"
                                               placeholder="First Name"/>
                                    </div>
                                </div>
                            </div>
                            </form>
                   </div>
            </div>

        );
    }
}
